    [],nt"revision_timestamp": "2015-05-07T00:59:28.028272",nt"name": "fir-detectors-cameras-based-on-gan-and-si-field-effect-devices-project",nt"isopen":
    true,nt"url": null,nt"notes": "SETI proposes to develop GaN and Si based
    multicolor FIR/THz camerasnwith detector elements and readout, signal processing
    electronicsnintegrated on a single chip.  The active detector elements will bensubmicron
    gated channels with 2 dimensional electron gas (2DEG). Thendevices with gated 2DEG
    (commonly known as field-effect transistors)nrespond to the incoming FIR radiation
    due to the rectification ofnradiation induced oscillations of electron density (electron
    plasma).nPhase I of the project will be devoted to the development, design, andncharacterization
    of the single pixel, consisting of an array ofnfield-effect transistors, targeting
    at responsivity increase of 100ntimes, and demonstrating the technical feasibility
    of 10^10 cm Hz^0.5/W detectivity.",nt"license_title": "U.S. Government Work",nt"extras":
